function customSortFruits(fruit1, fruit2) {
  if (hasSpecialCharacter(fruit1) && !hasSpecialCharacter(fruit2)) {
    return -1; // '@#$%' will be sorted before the remaining fruits in alphabetical order
  } else if (!hasSpecialCharacter(fruit1) && hasSpecialCharacter(fruit2)) {
    return 1; // '@#$%' will be sorted after the remaining fruits in alphabetical order
  } else {
    return fruit1.localeCompare(fruit2);
  }
}
```
