Here is an example of how you might implement Dijkstra’s algorithm in Python for finding the shortest path between two nodes in a graph:

```python
import heapq

def shortest_path(graph, start, end):
    heap = [(0, start)]
    distances = {node: float('infinity') for node in graph}
    distances[start] = 0
    previous_nodes = {}
    while heap:
        (curr_dist, curr_vertex) = heapq.heappop(heap)
        if curr_dist > distances[curr_vertex]:
            continue
        for neighbor, neighbor_distance in graph[curr_vertex].items():
            old_distance = distances[neighbor]
            new_distance = curr_dist + neighbor_distance
            if new_distance < old_distance:
                distances[neighbor] = new_distance
                previous_nodes[neighbor] = curr_vertex
                heapq.heappush(heap, (new_distance, neighbor))
    path = []
    while end is not None:
        path.append(end)
        end = previous_nodes.get(end, None)
    return distances, path[::-1]  # Return the shortest distance and the shortest path
```
In this code, `graph` is a dictionary where each key is a node in the graph and its value is another dictionary. This second dictionary represents edges (as keys) to other nodes with their associated weights (as values). The function returns two dictionaries: one containing distances from the start node to all other nodes, and one showing the shortest path between start and end nodes.

It's also important to note that this code assumes a non-negative edge weight graph. If your graph has negative edges or cycles (i.e., it doesn’t have to be connected), you will need a different algorithm like Bellman-Ford or Johnson.

